public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if(obj == null || getClass() != obj.getClass()) {
    return false;
  }

  ResourceSizing that = (ResourceSizing) obj;

  if(getNumAllocations() != that.getNumAllocations()) {
    return  false;
  }
  if(!getResources().equals(that.getResources())) {
    return false;
  }
  return true;
}
